// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.11;

contract Donations{

  event donation (uint amount,uint date, address donor);
  event NewFundraiser( string name, uint target, uint deadline, address owner);
  event withdawDonation(uint amount, uint date, address owner);
  event claimRefunds(uint amount, address claimer);


address claimAddress = 0xdD870fA1b7C4700F2BD7f44238821C26f7392148;

struct Donors{
    uint amount;
    address donorAddress;
    uint donationDate;
    }

struct NewDonation{
    string Name;
    uint  deadline;
    uint unclaimed_deadline ;
    uint  target;
    uint raisedAmount;
    address  owner;
    bool status;
    mapping(address => Donors) donors;
    address[]funders; 
  }

mapping(uint => NewDonation) public newdonation;

uint numDonations;

function createDonation(string calldata name, address beneficiary, uint _deadline, uint _target) external returns(uint donationID) {
donationID =numDonations++;
NewDonation storage d = newdonation[donationID];
  d.Name= name;
 d.deadline =block.timestamp + _deadline;
 d.unclaimed_deadline = _deadline + 300;
 d.target =_target;
 d.owner =  beneficiary;
 d.status =true;

 emit NewFundraiser(name,_target,_deadline,msg.sender);
 }


function donate(uint donationID) payable external {
NewDonation storage newdonate = newdonation[donationID];
require(block.timestamp < newdonate.deadline, "deadline has elapsed");
newdonate.raisedAmount += msg.value;
if(newdonate.donors[msg.sender].amount !=0){
newdonate.donors[msg.sender].amount+=msg.value;
}
else{
    newdonate.donors[msg.sender].amount=msg.value;
    newdonate.donors[msg.sender].donorAddress=msg.sender;
    newdonate.donors[msg.sender].donationDate=block.timestamp;
    newdonate.funders.push(msg.sender);
}
emit donation(msg.value,block.timestamp,msg.sender);
}

function withdawDonations(uint donationID) external {
  NewDonation storage newdonate = newdonation[donationID];
    require(newdonate.status == true,"No active Donation");
    require(block.timestamp > newdonate.deadline, "deadline not yet fufilled");
    require(newdonate.raisedAmount > newdonate.target, " target has not been met");
    newdonate.status =false;
    uint  amount= newdonate.raisedAmount;
     newdonate.raisedAmount =0;
    payable(newdonate.owner).transfer(amount);
  emit withdawDonation (amount,block.timestamp,msg.sender);
}

function claimRefund(uint donationID) external {
   NewDonation storage newdonate = newdonation[donationID];
    require(newdonate.status == true,"No active campaign to claimAddress refund from");
    require(block.timestamp > newdonate.deadline,"deadline have not elapsed");
    require(newdonate.raisedAmount < newdonate.target, "raisedAmount has  exceed target");
    require(newdonate.donors[msg.sender].amount > 0, "you have no active Donation");
    uint amount= newdonate.donors[msg.sender].amount;
   newdonate.raisedAmount -=amount;
    if(newdonate.raisedAmount ==0){
    newdonate.status =false;
    }
    newdonate.donors[msg.sender].amount =0;
    payable(msg.sender).transfer(amount);
  emit claimRefunds (amount,msg.sender);
    
}

// function unclaimedDonation() external{
// require(block.timestamp > unclaimed_deadline, "unclaimed_deadline not yet met");
// require( raisedAmount > 0, "no fund to claim");
// status =false;
// uint amount =raisedAmount;
// raisedAmount =0;
// payable(claimAddress).transfer(amount);

// }

 function getDonorInfo(uint donationID, address _donor) external view returns(Donors memory){
  NewDonation storage newdonate = newdonation[donationID];
  return newdonate.donors[_donor];
}

function getDonors(uint donationID) external view returns (address[] memory){
    NewDonation storage newdonate = newdonation[donationID];
    return newdonate.funders;

}
}
